import logo from './logo.svg';
import './App.css';
import useEffect from 'react';


function App() {

  useEffect(() => {
    fetch('/api')
      .then(res => res.json())
      .then(data => console.log(data))
  }, [])


  return (
    <div className="App">
      <h1>React App</h1>
    </div>
  );
}

export default App;
